import React from 'react';

function Footer() {
  return (
    <footer>
      <p>Connect with me:</p>
      <ul>
        <li><a href="https://github.com/developer">GitHub</a></li>
        <li><a href="https://linkedin.com/in/developer">LinkedIn</a></li>
        {/* Add links to other profiles */}
      </ul>
    </footer>
  );
}

export default Footer;
